import React from 'react';
import "./Aside_News.scss"
import NewsOld from './News_Old/NewsOld';


const AsideNews=(props)=>{
    return(
        <div className="Aside_News">
        <NewsOld NewsData={props.NewsPage.NewsData} 
         addPost={props.addPost} 
         updateNewPostText={props.updateNewPostText}>
         
         </NewsOld>
        </div>
    )
}

export default AsideNews
